import "./PageLoader.css"

const PageLoader = () => {
  return (
    <>
     <div className='page_loader_wrapper'>
        <img src={require("../../Images/giphy.gif")} alt="loader" className='page__loader' />
    </div>
    {
      window.location.reload()
    }
    
    </>
   
  )
}

export default PageLoader
